import { Avatar } from "@mui/material";
import React from "react";
import { useNavigate } from 'react-router-dom';
import { useLocation } from "react-router-dom";

const ProfilePage = () => {
    const location = useLocation();
    console.log(location.state.user , 'history');
    let userData = location?.state?.user;

    return (
        <div className="container" style={{display: 'flex' , height: '100vh'}}>
            <div className="sideMenu">
                <div className="menu-item">

                </div>
            </div>
            <div className="profile-data">
                <div className="pro-header">
                    <p style={{color: '#545454' , fontSize: '23px' , fontWeight: '500'}} >Profile</p>
                    <div style={{display: 'flex'}} >
                        <Avatar src={userData?.profilepicture} />
                        <p style={{color: '#545454' , fontSize: '23px' , fontWeight: '400', margin: '10px'}} >{userData?.name}</p>
                    </div>
                </div>
            </div>
        </div>
    )
}
export default ProfilePage;
